import React from 'react';
import Feature from '../../components/feature/Feature';
import './features.css';

const featuresData = [
  {
    title: '15 Different Filtering Mothods ',
    text: 'Automatically detects multiple spammer techniques.',
  },
  {
    title: 'Sensitive-Smart Mode',
    text: 'More likely to catch elusive spammers, but with more false positives.',
  },
  {
    title: 'Scan by Channel ID',
    text: 'Enter a known spammer channel link or ID directly.',
  },
  {
    title: 'Scan Usernames for',
    text: ' Individual special characters, individual strings, or using a custom Regex expression.',
  },
  {
    title: 'Scan Comment Text',
    text: ' Same 3 Options as Above.',
  },
  {
    title: 'Scan Usernames and Comment Text simultaneously',
    text: ' Same 3 Options as Above.',
  },
  {
    title: 'ASCII Mode',
    text: ' Scan Usernames for non-ASCII special characters (three different sensitivities)',
  },
];

const Features = () => (
  <div className="ytsp__features section__padding" id="features">
    <div className="ytsp__features-heading">
      <h1 className="gradient__text">The Features are gien below. Have some Ideas? Step into Community Today & Make your Ideas Happen by Contributing.</h1>
      <p>15 Different Filtering Methods</p>
    </div>
    <div className="ytsp__features-container">
      {featuresData.map((item, index) => (
        <Feature title={item.title} text={item.text} key={item.title + index} />
      ))}
    </div>
  </div>
);

export default Features;
